window.bookSummaryJSON = "<p><b>When the prize is death, some games are better lost than won.</b></p> <p>If she loses, she becomes his queen, and he unleashes war across Earth and Tir n’Aill alike. If she wins, he dies. The answer seems clear. But then why can’t she bring herself to want victory?</p> <p>The longer Abigail wanders through his Maze of Shadows, the less sure she becomes of anything—allies, enemies, wrong, right, evil, good, hate…and love. With every twist and turn, her heart is more fully trapped in his snare.</p> <p>Facing the choice of whether to win—and kill the Bloody Prince—or lose and become his queen, Abigail can’t decide which is worse. In fact, she is starting to think that she might no longer want to win at all.</p>"; 
